import React from 'react';

function ListDisplay({ savedLists }) {
  return (
    <div className="list-display">
      <h2>Saved Lists</h2>
      {savedLists.length > 0 ? (
        savedLists.map((list, index) => (
          <div key={index} className="list-item">
            <h3>{list.name}</h3>
            <p>Created on: {list.date}</p>
            <div className="image-display">
              {list.images.map((src, imgIndex) => (
                <img key={imgIndex} src={src} alt={`Response code ${list.codes[imgIndex]}`} />
              ))}
            </div>
          </div>
        ))
      ) : (
        <p>No saved lists.</p>
      )}
    </div>
  );
}

export default ListDisplay;
